import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";

import Sidebar from "./sidebar/Sidebar";
import Dashboard from "./dashboard/Dashboard";

function App() {
  return (
    <BrowserRouter>

      <Sidebar />

      <Routes>

        {/* Default Route */}
        <Route path="/" element={<Dashboard />} />

        {/* Dashboard Route */}
        <Route path="/dashboard" element={<Dashboard />} />

        <Route path="/erp" element={<h2 style={{ marginLeft: "240px" }}>ERP Setting</h2>} />
        <Route path="/masters" element={<h2 style={{ marginLeft: "240px" }}>Masters</h2>} />
        <Route path="/purchase" element={<h2 style={{ marginLeft: "240px" }}>Purchase</h2>} />
        <Route path="/store" element={<h2 style={{ marginLeft: "240px" }}>Store</h2>} />
        <Route path="/production" element={<h2 style={{ marginLeft: "240px" }}>Production</h2>} />
        <Route path="/quality" element={<h2 style={{ marginLeft: "240px" }}>Quality</h2>} />
        <Route path="/sales" element={<h2 style={{ marginLeft: "240px" }}>Sales</h2>} />

      </Routes>

    </BrowserRouter>
  );
}

export default App;
